import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => (
  <nav>
    <h1>Book App</h1>
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/my-book-list">My Book List</Link>
      </li>
    </ul>
  </nav>
);

export default NavBar;
